import React from 'react';
import './Section.css'

// sections
import AboutMeBlurb from '../Blurbs/AboutmeBlurb/AboutMeBlurb';
import SkillsBlurb from '../Blurbs/SkillsBlurb/SkillsBlurb';
import ProjectsBlurb from '../Blurbs/ProjectsBlurb/ProjectsBlurb';

const Section = (props) => {

    let content = null;

    switch (props.id) {
        case 'aboutme':
            content = <AboutMeBlurb/>
            break;
        case 'skills':
            content = <SkillsBlurb/>
            break;
        case 'projects':
            content = <ProjectsBlurb/>
            break;
    }

    return (
        <div id={props.id} className="section">
            <div className="section__content">
                {content}
            </div>
            <div className="section__overlay"></div>
      </div>
    );
}

export default Section;
